import React, { useState } from 'react';
import CreateEventForm from './CreateEventForm';

const ClubDashboard = ({ events, onCreateEvent, handleConsultarBoletas, handleCrearServicio }) => {
  const [createEventOpen, setCreateEventOpen] = useState(false);

  const handleCreateEventSubmit = (formData) => {
    console.log('Datos del formulario:', formData);
    if (typeof onCreateEvent === 'function') {
      onCreateEvent(formData);
    }
    setCreateEventOpen(false);
  };

  const toggleCreateEvent = () => {
    setCreateEventOpen(!createEventOpen);
  };

  return (
    <div>
      <h1>Dashboard del Club</h1>
      <button onClick={toggleCreateEvent}>Crear Evento Deportivo</button>
      
      {/* Formulario para crear evento */}
      {createEventOpen && (
        <CreateEventForm onSubmit={handleCreateEventSubmit} />
      )}

      {/* Lista de eventos */}
      <h2>Eventos Creados</h2>
      <ul>
        {events.map(event => (
          <li key={event.id}>
            <div>
              <strong>Nombre:</strong> {event.name}<br />
              <strong>Fecha:</strong> {event.date}<br />
              <strong>Hora:</strong> {event.time}<br />
              <strong>Ubicaci√≥n:</strong> {event.location}<br />
              <button onClick={() => handleConsultarBoletas(event.id)}>Consultar Boletas Vendidas</button>
              <button onClick={() => handleCrearServicio(event.id)}>Crear Servicio Adicional</button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ClubDashboard;
